import './App.css';
import React from "react";
import MainPage from "./componetns/MainPage";

function App() {
    const [jsonData, setJsonData] = React.useState({});

    React.useEffect(() => {
        const fetchJSON = async () => {
            const response = await fetch("/file.json");
            let json = await response.json();
            setJsonData(json);
        };

        fetchJSON();
    }, []);

    return (
        <MainPage/>
    );
}

export default App;
